  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mingo National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1959. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and disease- is also covered. The Refuge development section discusses physical
  developments, plantings, collections and receipts, and vegetation control. A progress
  report on field investigations and applied research is included. Resource management
  is outlined; topics include haying, fur harvesting, and timber removal. The public
  relations section discusses recreational uses, Refuge visitors, Refuge participation,
  hunting, and violations. Items of interest and N-R forms are attached.\",\n\t\"owner_org\":
